import React from 'react';

function Header () {

    return (

<>
<header>
                <nav>
                    <div>
                        <p>
                            {/* <a href="/" title="Built by Buffalo - Web Design Brighton UK" class="active">
                                <img src="/assets/img/logo-plain@2x.png" alt="Built by Buffalo - Web Design Brighton UK"></img>
                            </a> */}
                        </p>
                        <br></br>
                        <p><a href="/">Home</a></p>
                        <p><a href="/work">Work</a></p>
                        <p><a href="/about">About</a></p>
                        <p><a href="/feed">Feed</a></p>
                        <p><a href="/jobs">Jobs</a></p>
                        <p><a href="/contact">Contact</a></p>
                    </div>
                </nav>
                <hr class="grid-2 center mq-mobile"></hr>
                    {/* <h1 id="tagline">A higher plain</h1> */}
</header>
</>

    );
}

export default Header;
